Row.VALUE:
Arena rules
 1. Points determine the ranking， the final ranking is released every 3 days. System will automatically issue the ranking rewards and then the points are reset; 
 2. You can challenge 10 times for free per day (Challenge is either successful or failing will both consume challenge times)， but challenge will enter to CD if defeat; 
 3. After defeating the 5 opponents from one same list， you can receive penta kill rewards， which can only be received once a day; if you refresh the list in the middle， the number of kills will be reset to zero; 
 4. Challenge based on the results of the battle and the ranking of both sides to calculate the arena points and glory points can be gained. The palyer who is be challenged will not receive any arena points nor glory points; 
 5. The glory points are used to activate the arena title， and the glory points will never be reset; 
 6. The higher the arena title， the higher the attributes of its bonus， and the more glory points will be consumed;

Trial rules
 1. You can challenge for free 1 time per day. Each trial star field has its own entry requirements and share the challenge times; 
 2. The trial progress is permanently saved， and for the trials which have been passed with perfectly full stars cannot be challenged again; 
 3. You can choose to the spaceships you want before entering the trial. You cannot make any changes after entered the trial. In the end of each battle， the HP left for every spaceship will be kept into the next battle， and the spaceship that you've lost in the last battle cannot be used again. 
 4. During the trial， you still can return to your base to train your spaceships or do other operations. When you return to the trial， the spaceship attributes will be updated to the latest; 
 5. During the trial， the reset function can be used to immediately end the trial; 6. Each trial only has rewards for the first kill， but you can accumulate the passing stars to get the star treasure chest;

Galaxy rules
 1. Resource collection ---- three resource mines， the higher the level， the larger the storage. The collecting speed depends on the player level and the Command Center level; after the collection is completed， the troops will automatically return with the collected resources and you will receive an email reminder. You need to deploy the expedition team， and it occupy the expedition queue; there are monsters in some resource mines needed to be defeated before collecting resources， this process does not consume Stamina; 
 2. Resource plunder ---- when the resource mine has been occupied by other players， you can initiate plunder. You can plunder part of the collected resources after victory and automatically occupy the resource mine to continue collecting the remaining resources; you need to deploy the expedition team， and it occupy the expedition queue， this process consumes Stamina; 
 3. Salvage the wreckage----it takes time; the higher the level of the wreckage， the more abundant the reward; after joining an Alliance， there will be additional Alliance gift package rewards; no need to deploy the expedition team， but it occupy the expedition queue and consumes Stamina; 
 4. Destroy the astroid belt - the astroid belt contains all kinds of items， there's probability to trigger the monsters battle during destroying; you need to deploy the expedition team， and it occupy the expedition queue， this process consumes Stamina; 
 5. Raid-------- for the players active in current area; you can get great rewards after victory; you need to deploy the expedition team， and it occupy the expedition queue， this process consumes a lot of Stamina;
